    //         <button class="menu-btn disabled" disabled>Más Vistas o Menos Vistas</button>
    //     </main>
    //     <footer class="footer">
    //         <p>© 2025 Eurodle. Unidos por la música.</p>
    //     </footer>
    // </div>
  );
}

export default App;
